// ==UserScript==
// @name         captcha bot
// @version      1.2.9
// @description  buys / upgrades all farm towns
// @author       Mier
// @include      https://*.grepolis.com/game/*
// @grant        none
// @namespace https://greasyfork.org/users/984383
// @downloadURL https://update.greasyfork.org/scripts/478258/captcha%20bot.user.js
// @updateURL https://update.greasyfork.org/scripts/478258/captcha%20bot.meta.js
// ==/UserScript==

(async function() {
    const sleep = (n) => new Promise((res) => setTimeout(res, n));
    await sleep(2500)

    var css_white = {'background': 'white no-repeat scroll -2px -3px'}


    captcha_bot = {};

    captcha_bot.tools = [];

    captcha_bot.test = 0;

    captcha_bot.audio = new Audio("data:audio/wav;base64,");
    captcha_bot.audio.loop = true;

    captcha_bot.check_toollist = async function() {
        
        try {
            console.log("Checking for Farm bot.")
            await captcha_bot.tools.push(farm_bot);
        } catch {
            console.log("No Farm bot found.")
        }
        try {
            console.log("Checking for Culture bot.")
            await captcha_bot.tools.push(culture_bot);
        } catch {
            console.log("No Culture bot found.")
        }
        try {  
            console.log("Checking for Cave bot.")
            await captcha_bot.tools.push(cave_bot);
        } catch {
            console.log("No Cave bot found.")
        }
    }

    captcha_bot.stop_tools = function() {
        captcha_bot.tools.forEach(function(tool) {
            tool.stop_tool();
        })
    }

    captcha_bot.start_tools = function () {
        captcha_bot.tools.forEach(function(tool) {
            tool.start_tool();
            sleep(2000 + Math.random() * 1000)
        })
    }

    captcha_bot.switch = function () {
        captcha_bot.tools.forEach(function(tool) {
            tool.on = !tool.on;
            if (tool.on) {
                tool.start_tool();
            } else {
                tool.stop_tool();
            }
        })
    }

    captcha_bot.captcha_checker = function () {
        if ($('.botcheck').length || $('#recaptcha_window').length || captcha_bot.test) {
            console.log("captcha!")
            captcha_bot.stop_tools();
            captcha_bot.start_alarm();
            captcha_bot.start_captcha_loop();
        } else {
            setTimeout(captcha_bot.captcha_checker, 1000);
        }
    }

    captcha_bot.start_captcha_loop = function () {
        if (!($('.botcheck').length || $('#recaptcha_window').length || captcha_bot.test)) {
            captcha_bot.stop_alarm();
        } else {
            setTimeout(captcha_bot.start_captcha_loop, 300);
        }
    }

    captcha_bot.start_alarm = function() {
        if (captcha_bot.audio.paused) {
            console.log("Started alarm.")
            captcha_bot.audio.play();
        }
    }

    captcha_bot.stop_alarm = function() {
        console.log("Stopped alarm.")
        captcha_bot.audio.pause();
    }

    captcha_bot.add_menu_button_to_toolbar = function () {
        $('<div class="activity_wrap"><div class="activity start_all"><div class="divider"></div></div></div>').insertAfter($('.toolbar_activities .middle .activity_wrap:last-child'));

        startall_button = $('div .start_all');
        startall_button.css(css_white);
        startall_button.on('click', captcha_bot.switch);

        console.log("added startall button")
    }

    captcha_bot.check_toollist();
    captcha_bot.captcha_checker();
    captcha_bot.add_menu_button_to_toolbar();
    
}());